import styled from "styled-components";
export const ContentBlock = styled.div`
  width: 100%;
  height: 85vh;
  display: flex;
  position: relative;
`;

export const ContentPage = styled.section`
  width: 90%;
  height: 85vh;
  background-color:#eee;
`;

export const ContentItem = styled.article`
  margin-top: 5%;
  height: 90%;
  background-color:fuchsia;
  border-radius: 35px;
`;
